{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/varshinikhatrivijay/case-study-with-google-sheets-r-bellabeat?scriptVersionId=107121789\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"c3b490e8","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","papermill":{"duration":0.008419,"end_time":"2022-10-03T18:19:17.280508","exception":false,"start_time":"2022-10-03T18:19:17.272089","status":"completed"},"tags":[]},"source":["**Introduction**\n","Bellabeat is a high-tech manufacturer of health-focused products for women focusing on smart devices. Some of the products include the Bellabeat app, a wellness tracker called Leaf, a wellness watch and a waterbottle that tracks dailt water intake. \n","Bellabeat offers a subscription-based membership program for users that includes fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","\n","**Business Task**\n","Identify opportunities for growth that inform Bellabeat's marketing strategy based on trends in smart device usage \n","\n","**Key Stakeholders**\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","* Sando Mur: Mathematician and Bellabeat’s cofounder\n","* Bellabeat marketing analytics team\n","\n","**The data**\n","* For the analysis we will be using FitBit Fitness Tracker Data (CC0: Public Domain, dataset made available through Mobius). which contains personal fitness tracker from thirty fitbit users.\n","* The dataset is in long format and contains 18 files in .csv format\n","* It is good, reliable and comprehensive dataset generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016\n","* As we are looking at high level trends, we are going to focus on the daily usage metrics\n","\n","**Prepare:**\n","We shall begin to prepare the data for analysis"]},{"cell_type":"code","execution_count":1,"id":"bba80328","metadata":{"execution":{"iopub.execute_input":"2022-10-03T18:19:17.299037Z","iopub.status.busy":"2022-10-03T18:19:17.295873Z","iopub.status.idle":"2022-10-03T18:19:18.826081Z","shell.execute_reply":"2022-10-03T18:19:18.824211Z"},"papermill":{"duration":1.542446,"end_time":"2022-10-03T18:19:18.829471","exception":false,"start_time":"2022-10-03T18:19:17.287025","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n"]}],"source":["#loading libraries\n","library(tidyverse)\n","library(lubridate)\n","library(dplyr)\n","library(ggplot2)\n","library(tidyr)"]},{"cell_type":"markdown","id":"bb196bdd","metadata":{"papermill":{"duration":0.006819,"end_t