y time and toal minutes asleep. This might not mean that total minutes asleep is caused by more sedentary time, but it can be one of the factors that influence it. It is known that people who are more active sleep better. However, we can take away that some users can use frequent reminders to move and stand up more often, which could help their quality of sleep.\n"]},{"cell_type":"markdown","id":"f8ac30c4","metadata":{"papermill":{"duration":0.02244,"end_time":"2022-10-03T18:19:25.794554","exception":false,"start_time":"2022-10-03T18:19:25.772114","status":"completed"},"tags":[]},"source":["**Summary & Recommendations**\n","* From the analysis above, Bellabeat users could benefit from being reminded to walk or stand every few hours. This could increase their total steps & activity levels as well as decrease their sedentary time\n","* Bellabeat users could also benefit from recommendations regarding activity intensity levels. Users could be encouraged to increase their intensity depending on the level they are at to see better results. Most users burn more calories or have more steps when they spend more time in form of 'very active minutes' \n","* Users could be encouraged to practice better sleeping habits through better exercise. Sleep has a strong relationship with calories burned and a sedentary lifestyle"]},{"cell_type":"markdown","id":"013ee2a1","metadata":{"papermill":{"duration":0.021998,"end_time":"2022-10-03T18:19:25.838179","exception":false,"start_time":"2022-10-03T18:19:25.816181","status":"completed"},"tags":[]},"source":["P.S.\n","* This is my first attempt when it comes to working with R. There is a lot of trial and error involved in my visualizations, I am still learning, please be kind. Suggestions/ recommendation are welcome.\n","* Also, I would like to use data visualization to show sedentary, lightly, fairly and very active active data in one chart to show  what each looks like compared to the others. I assume I would not require a Y axis value,